export const allRoomToggle = (index, bool) => {
    if (index == 0) {
        allRoomObjs.forEach((item) => {
            if (item.name == "筛分间") {
                item.visible = bool;
            }
        });
    } else if (index == 1) {
        allRoomObjs.forEach((item) => {
            if (item.name == "均化间") {
                item.visible = bool;
            }
        });
    } else if (index == 2) {
        allRoomObjs.forEach((item) => {
            if (item.name == "立磨间") {
                item.visible = bool;
            }
        });
    } else if (index == 3) {
        allRoomObjs.forEach((item) => {
            if (item.name == "碎石配料间") {
                item.visible = bool;
            }
        });
    } else if (index == 4) {
        allRoomObjs.forEach((item) => {
            if (item.name == "破碎间") {
                item.visible = bool;
            }
        });
    } else if (index == 5) {
        allRoomObjs.forEach((item) => {
            if (item.name == "堆石厂") {
                item.visible = bool;
            }
        });
    }
};

// 漫游小车显示隐藏
export const manyouCarToggle = (bool, isPlay) => {
    manyouCar.visible = bool;
    if (bool) {
        manyouCarAnimation.time = 0;
    }
    if (isPlay == null) return false;
    if (isPlay) {
        manyouCarAnimation.loop = THREE.LoopOnce;
        manyouCarAnimation.time = 0;
        manyouCarAnimation.enabled = true;
        manyouCarAnimation.paused = false;
        manyouCarAnimation.clampWhenFinished = true;
    } else {
        manyouCarAnimation.paused = true;
    }
};

// 均化间漫游时单独高亮显示立磨间密相泵物体
export const junhuaRomaingLight = (bool) => {
    let outArr = [];
    junhuaRomaingMesh.traverse((s) => {
        if (s.isMesh) {
            outArr.push(s);
        }
    });
    container.outlineObjects = bool ? outArr : [];
};

// 均化间漫游时单独显示单条输送管道
export const junhuaRomaingLines = (bool, color) => {
    if (bool) {
        GDmodel.traverse((child) => {
            child.visible = false;
        });
        GDmodel.visible = true;
        GDmovingSS.parent.visible = true;
        let arrs = [];
        GDmovingSS.traverse((child) => {
            child.visible = true;
            if (child.isMesh) {
                child.visible = false;
                if (
                    child.name == "输送动画M01" ||
                    child.name == "405仓密相泵AB动画" ||
                    child.name == "A动画" ||
                    child.name == "B动画"
                ) {
                    child.visible = true;
                }
                child.material.color.set(color);
                arrs.push(child);
            }
        });
        container.outlineObjects_2 = arrs;
        container.outlinePass_2.hiddenEdgeColor = new THREE.Color(color);
        container.outlinePass_2.visibleEdgeColor = new THREE.Color(color);
    } else {
        pipeLineFun(0);
    }
};

